import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom'
import Drugs from './Drugs';

function App() {
  return (
    <div>
      <Router>
        <Route exact path="/" component={Home} />
        <Route path="/register" component={Drugs} />
      </Router>
    </div>
  )
}

function Home() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="/welcome.png" />
          <Link to="/drugs">
          <button className="Button">
          <p className="Button_police">
            connexion
          </p>
          </button>
          </Link>
      </header>
      <body className="App-body">
        <img src="/cana.png" className="App-logo" alt="logo" />
      </body>
    </div>
  );
}

export default App;
